import React from 'react';

const RoundImgBtnWDescription = ({ image, description, url }) => {
  const handleClick = () => {
    // Redirect to the provided URL
    window.open(url, '_blank');
  };

  return (
    <div className="text-center">
      <button onClick={handleClick} className="rounded-full w-16 h-16 p-0 mx-auto overflow-hidden">
        <img src={image} alt="Button Image" className="w-32 h-32 object-cover" />
      </button>
      <p className="mt-2">{description}</p>
    </div>
  );
};

export default RoundImgBtnWDescription;
